Here are the step-by-step workings to solve 73+45 in base-8:

73 = 7*8^1 + 3*8^0
45 = 4*8^1 + 5*8^0

Adding the digits in the ones place (8^0): 
3 + 5 = \boxed{10}

Since 10 is greater than the base (8), we have a carry of 1. 
Add the digits in the tens place (8^1), plus the carry:
7 + 4 + 1 = \boxed{12}

Again, since 12 is greater than the base (8), we have a carry of 1.
There are no more digits to add, so the final carry is the result.

\boxed{1}

So in base-8, 73+45 = \boxed{1}

Here are the step-by-step workings to calculate 77+33 in base-8:

7 + 3 = 10 
In base-8, 10 = 8 + 2 = \boxed{12}

So the result is:
\boxed{12}
